import React from "react";
import Table from "../../commons/tables/table";


const columns = [
    {
        Header: 'Name',
        accessor: 'name',
    },
    {
        Header: 'Gender',
        accessor: 'gender',
    },
    {
        Header: 'Birthday',
        accessor: 'birthday',
    },
    {
        Header: 'Address',
        accessor: 'Address',
    },
    {
        Header: 'Medical-Record',
        accessor: 'record',
    },
    {
        Header: 'Caregiver',
        accessor: 'caregiver',
    },
    {
        Header: 'Medication Plan',
        accessor: 'medplan',
    }
];

const filters = [
    {
        accessor: 'name',
    }
];

class PatientTable extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            tableData: this.props.tableData
        };
    }

    render() {
        return (
            <Table
                data={this.state.tableData}
                columns={columns}
                search={filters}
                pageSize={5}
            />
        )
    }
}

export default PatientTable;
